The Sound of Love / Il Suono della Trasgressione (2014)

Sofia e la ricca ed avvenente proprietaria di una etichetta discografica indipendente. Malgrado i vizi ai quali si dedica spronata dal suo amante di turno non ha preso ne la passione ne tantomeno il fiuto del suo lavoro. L'incontro con uno zingaro chiamato &quot;Il Principe&quot;, affascinante musicista ambulante, le fa ritrovare l'antico piacere di apprezzare la buona musica e la condurra sui sentieri di un sesso sfrenato e selvaggio. Sofia portera &quot;Il Principe&quot; al successo... Ma sara a sua volta guidata con grinta e fermezza ad assaporare il gusto intenso dei piaceri della carne.

Aletta Ocean, Aliz, Brandy Smile, Katy Cambell, Rose, Sandra Steel, Denis Marti, Laslie Taylor, Lauro Giotto, Nick Lang, Zenza Raggi

